// 引入Vue
import Vue from 'vue'
// 引入App
// 关闭Vue的生产提示
Vue.config.productionTip = false
// 创建vm
new Vue({
    el: '#app',
    data() {
    },

    // render: h => h(App)
    render: (createElement) => {
        return createElement('h1', '你好')
    }
})
